Join me for a special @unitedcards event in D.C. that is all about two of my favorite things: food and baseball! I’ll be hosting a Q&A at @thesaltline to talk about my career, take photos together, and then share a dinner featuring some of the restaurant’s New England classics. 🦀 To top off the evening, you’ll get to attend the game across the street at Nationals Park – make sure to bring your gear to cheer on our team!

To find out more and purchase tickets, visit UnitedCardEvents.com.

